import { Link } from 'react-router-dom';

const Navbar = () => (
  <nav>
    <Link to="/">Home</Link>
    <Link to="/coworking-spaces">Coworking Spaces</Link>
    <Link to="/visa-info">Visa Info</Link>
    <Link to="/communities">Communities</Link>
  </nav>
);
